import React,{useState,useEffect} from 'react'

const Profile = () => {
  const [data,setdata] = useState([]);

    useEffect(() => {
        getroom();
    }, [])

    const getroom = async () => {
        let response = await fetch('http://localhost:8080/api/room');
        let res = await response.json();
        setdata(res.message);
        console.log(res)
    }
  return (
      <div className='container'>
        {data && data.map((value,index)=>{
            return (
                <div className="card2 mb-3" style={{ maxWidth: "540px" }}>
                    <div className="row no-gutters">
                        <div className="col-md-4">
                            <img src="https://img.freepik.com/free-vector/flat-hotel-facade-background_23-2148157379.jpg?w=2000" className="card-img" alt="..." />
                        </div>
                        <div className="col-md-8">
                            <div className="card-body">
                                <h5 className="card-title">Card title</h5>
                                <p className="card-text">This is a wider card with supporting text below as a natural lead-in to additional content. This content is a little bit longer.</p>
                                <p className="card-text"><small className="text-muted">Last updated 3 mins ago</small></p>
                            </div>
                        </div>
                    </div>
                </div>
            )
          })}
      </div>
  )
}

export default Profile
